import React from 'react'
import Button from 'react-bootstrap/Button';
import ButtonGroup from 'react-bootstrap/ButtonGroup';

const GroupButtons = () => {
    return (
        <div>
        <ButtonGroup>
        <Button>Day</Button>
        <Button>Month</Button>
        <Button>Year</Button>
        </ButtonGroup>
        </div>
    )
}

export default GroupButtons
